sys_hub_input_scripts.script:
{"conditions":{"scriptActive":true,"script":"/*
**Access Flow/Action data using the fd_data object. Script must return a value. 
**Order number is offset by +1 in Error Handling Section.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
**
**Requires GlideRecord encodedQuery response, example:
**"active=true^short_descriptionSTARTSWITHtest";
*/
return 'source=' + fd_data.subflow_inputs.source.sys_id + '^github_idNOT IN' + fd_data.flow_var.repository_ids;"}}

{"repository_ids":{"scriptActive":true,"script":"/*
**Access Flow/Action data using the fd_data object. Script must return a value. 
**Order number is offset by +1 in Error Handling Section.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/
const repositoryIDs = fd_data.flow_var.repository_ids;
const repositoryID = fd_data._3__for_each.item.id;
return repositoryIDs + (repositoryIDs ? ',' : '') + repositoryID;"}}

{"webhook_url":{"scriptActive":true,"script":"/*
**Access Flow/Action data using the fd_data object. Script must return a value. 
**Order number is offset by +1 in Error Handling Section.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/
return gs.getProperty('glide.servlet.uri') + 'api/x_376096_mpl/git/webhooks';"}}

{"access_token":{"scriptActive":true,"script":"/*
**Access Flow/Action data using the fd_data object. Script must return a value. 
**Order number is offset by +1 in Error Handling Section.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/
return fd_data.subflow_inputs.source.github_access_token.getDecryptedValue();"}}

